import React, { useEffect, useRef } from 'react'
import FountainAnimator from './fountain'

const App = () => {

  const fountainContainerEl = useRef(null)
  useEffect(() => {
    const fountainAnimator = new FountainAnimator() 
    fountainAnimator.start()
    return () => {
         fontainAnimator.destroy()
     }
  }, [])

  return <div ref={fountainContainerEl} /> 


  useEffect(() => {
    window.addEventListener('resize', () => console.log(1))
  }, [])


  return <div>{typeof window}</div>
}

export default App
